    const styles={
        carButton:{
            backgroundColor:'black',
            color:'white',
            fontSize:'20px',
            padding:'10px 60px',
            margin:'10px 0px',
            cusor:'pointer'
        }

    }
  return (
    <div>
            {carData.map(car=> (
                <div>
                    <button style={styles.carButton}>{car.Name}</button>
                </div>

            ))}
    </div>
  )
}
